(18,	94,	'30% off an Entry Level CV',	'Are you an entry level professional or an NYSC corper? We have almost 30% discounts for you on our entry level CV package. A CV is often all a prospective employer needs to quickly have an understanding of who you are, so creating a powerful first impression is absolutely vital. Whether you\'ve set your sights on changing companies, or simply regaining employment, with our evident expertise in this field we are confident that our assistance will maximise your chances of getting the job you deserve. Full money back and satisfaction guaranteed.',	'deal_hQhHGXM3BMpfdeN.jpg',	'GwYcggB',	2000,	0,	1,	0,	9,	'Resume & Cover Letter Writer',	100,	'2016-06-01 22:45:03',	'2016-08-30 14:02:13'),
(19,	94,	'30% off an Mid-Career Level CV',	'Do you have a work experience of 2-10 years? We have 30% discount for you on our mid-career level CV package. A CV is often all a prospective employer needs to quickly have an understanding of who you are, so creating a powerful first impression is absolutely vital. Whether you\'ve set your sights on changing companies, or simply regaining employment, with our evident expertise in this field we are confident that our assistance will maximise your chances of getting the job you deserve. Full money back and satisfaction guaranteed.',	'deal_FLW1wrqnhJP1lrW.jpg',	'rv3CTdn',	3000,	0,	1,	0,	10,	'Resume & Cover Letter Writer',	100,	'2016-06-01 22:47:29',	'2016-07-06 23:44:12'),
(20,	94,	'30% off a Senior Management Level CV',	'Do you have a work experience of over 10 years? We have 30% discount for you on our senior management level CV package. A CV is often all a prospective employer needs to quickly have an understanding of who you are, so creating a powerful first impression is absolutely vital. Whether you\'ve set your sights on changing companies, or simply regaining employment, with our evident expertise in this field we are confident that our assistance will maximise your chances of getting the job you deserve. Full money back and satisfaction guaranteed.',	'deal_qaxe4NiGm7I8tJ4.jpg',	'TqhHoeL',	5000,	0,	1,	0,	18,	'Resume & Cover Letter Writer',	100,	'2016-06-01 22:54:31',	'2016-07-04 18:21:22'),
(21,	137,	'Computer and Phone Engineer',	'Computer an phone engineer: hardware and software, system upgrade and maintanance, operating system installation.',	'',	'YyUmdvP',	1000,	0,	0,	0,	0,	'Electronics Repairer',	1000,	'2016-06-06 23:08:36',	NULL),
(22,	141,	'System Modeling Consultant',	'I design and develop simulation models for business, education, research and policy analysis.',	'deal_eMQfDFWHyWo5wEa.jpg',	'QpFDECA',	100,	0,	0,	0,	1,	'Software Programmer',	10,	'2016-06-07 02:37:50',	'2016-06-07 03:29:12'),
(23,	138,	'Will give you 100 Female or Male Real Phone Contacts for SmS Adverts',	'What makes a business popular?\r\nWhat increases sales?\r\nWhat drives traffic to your website/blog?\r\nWhat makes a brand/ product most wanted?\r\nThe answer is ADVERTISEMENT ‎\r\n  Advertisement is when you promote/advertise your brand,product,website,goods and services to get a the attention of an audience who needs it.\r\nEver wondered why Jumia, Konga, Dealdey and the rest are popular? Only because of the massive traffic gotten through advertising. Example of their modes of advert is bulk sms adverts. \r\nYou will get\r\n* Real active phone numbers\r\n* Opportunity to choose either male or female groups of 100 only.‎\r\n* 100 active numbers that can be used for promotional adverts.\r\n* Can be used for divers promotions,like for beauty products you require female contacts while for gadgets you require male contacts.\r\nSo what are you waiting for order now!!! ‎\r\n‎',	'deal_WZuZoFC8tDVMyKp.png',	'J8VQTKM',	3000,	0,	0,	0,	6,	'Caterer',	100,	'2016-06-07 17:03:34',	'2016-06-13 17:30:17'),
(24,	137,	'Computer & Phone Engineer',	'Computer repair ( Hardware and Software)\r\nInstallation/Upgrading of OS (windows 10, 8.1, 8, 7 e.t.c)\r\nPhones / Tablets Repair (Hardware and Software)\r\nTel: 07034655303, 08095872158',	'deal_M4hXAXQs8UyD35O.jpg',	'ciN9P8M',	2000,	0,	1,	0,	2,	'Electronics Repairer',	1000,	'2016-06-08 03:34:24',	'2016-06-11 17:27:24'),
(25,	137,	'System Engineer',	'Computer repair ( Hardware and Software), Installation/Upgrading of OS (windows 10, 8.1, 8, 7 e.t.c), Phones / Tablets Repair (Hardware and Software). Tel: 07034655303, 08095872158',	'deal_nfcGozjO9G4bk0G.jpg',	'y8huiSE',	2000,	0,	1,	0,	4,	'Select Category',	1000,	'2016-06-08 04:03:26',	'2016-07-14 13:32:05'),
(26,	141,	'System Modeling Consultant',	'I design and develop simulation models for Education, Business, Agriculture, and Policy Research',	'deal_YrOdOAXLhmg3nR5.jpg',	'GIekb4j',	100000,	0,	1,	0,	1,	'Software Programmer',	1000,	'2016-06-08 23:26:19',	'2016-06-10 13:11:11'),
(27,	170,	'Creative Design Tutor',	'Full design training: From Illustrator to Cinema 4d. The Basic to Professional tutoring, just a phone call away! Note: A vivid imagination is very important and we tend to unwrap the mechanics of a natural creative mind genius',	'',	'bg77tY5',	75000,	0,	1,	0,	19,	'Graphic designer',	1,	'2016-06-09 15:57:04',	'2016-07-12 07:54:58'),
(28,	122,	'I\'ll do afterschool training for 2 children for just N10,000 ',	'I am an experienced teacher. I have worked with different schools and many children. My experience with coaching pupils and the success that I\'ve been blessed with has made me confident that working with yours won\'t be an exception.\r\n\r\nI teach \r\n- Primary 1-6 pupils.\r\n- JSS 1 - JSS3 students.\r\n \r\n- This deal is targeted at homes within Shomolu, Bariga, Gbagada and environs.\r\n- Charges will increase a little for families outside these places.',	'',	'pdDAYB6',	10000,	0,	1,	0,	2,	'Teacher',	2,	'2016-06-10 15:22:11',	'2016-06-15 17:21:58'),
