(102,	180,	'Ethical Hacking Bootcamp ',	'<p><strong>OVERVIEW</strong></p><p>The new CEHv9 provides a comprehensive ethical hacking and network security-training program to meet the standards of highly skilled security professionals. CEHv9 focuses on the latest hacking attacks targeted to mobile platforms and target computers and covers countermeasures to secure mobile infrastructure.</p><p>The Ethical Hacking Bootcamp is loaded with simplified advanced technical content with an emphasis on vulnerability assessment, risk assessment, penetration testing and system protection. Latest tools and exploits uncovered from the underground community will be featured all in a bid to improve the security posturing of organisations.</p><p>&nbsp;</p><p><strong>ETHICAL HACKING COURSE OUTLINE</strong></p><p>CEHv9 consists of 20 core modules designed to facilitate a comprehensive ethical hacking and penetration testing training.</p><ol><li>&nbsp; &nbsp;Introduction to Ethical Hacking</li><li>&nbsp; &nbsp;Footprinting &amp; Reconnaissance</li><li>&nbsp; &nbsp;Scanning Networks</li><li>&nbsp; &nbsp;Enumeration</li><li>&nbsp; &nbsp;System Hacking</li><li>&nbsp; &nbsp;Trojan &amp; Backdoors</li><li>&nbsp; &nbsp;Viruses &amp; Worms</li><li>&nbsp; &nbsp;Sniffing</li><li>&nbsp; &nbsp;Social Engineering</li><li>&nbsp; &nbsp;Denial of Service</li><li>&nbsp; &nbsp;Session Hijacking</li><li>&nbsp; &nbsp;Hacking Webservers</li><li>&nbsp; &nbsp;Hacking Web Applications</li><li>&nbsp; &nbsp;SQL Injection</li><li>&nbsp; &nbsp;Hacking Wireless Networks</li><li>&nbsp; &nbsp;Hacking Mobile Platforms</li><li>&nbsp; Evading IDS, Firewalls &amp; Honeypots</li><li>&nbsp; Buffer Overflows</li><li>&nbsp; Cryptography</li><li>&nbsp; Penetration Testing</li></ol><p><strong>DURATION</strong></p><p>5 Days</p><p>&nbsp;</p><p><strong>WHAT WILL YOU LEARN?</strong></p><ol><li>&nbsp; &nbsp;&nbsp;Key issues plaguing the information security world, incident management process, and penetration testing</li><li>&nbsp; &nbsp;&nbsp;Various types of footprinting, footprinting tools and countermeasures</li><li>&nbsp; &nbsp;&nbsp;Network scanning techniques and scanning countermeasures</li><li>&nbsp; &nbsp;&nbsp;Enumeration techniques and enumeration countermeasures</li><li>&nbsp; &nbsp;&nbsp;System hacking methodology, steganography, steganalysis attacks and covering tracks</li><li>&nbsp; &nbsp;&nbsp;Different types of Trojans, Trojan analysis, and Trojan countermeasures</li><li>&nbsp; &nbsp;&nbsp;Working of viruses, virus analysis, computer worms, malware analysis procedure, and countermeasure</li><li>&nbsp; &nbsp;&nbsp;Packet sniffing techniques and how to defend against sniffing</li><li>&nbsp; &nbsp;&nbsp;Social Engineering techniques, identity theft, social engineering countermeasures</li><li>&nbsp; &nbsp;DoS/DDoS attack techniques, botnets, DDoS attack tools and DoS/DDoS countermeasures</li><li>&nbsp; &nbsp;Session hijacking techniques and countermeasures</li><li>&nbsp; &nbsp;Different types of webserver attacks, attack methodology, and countermeasures.</li></ol>',	'',	'fJq79OI',	55,	85,	0,	0,	0,	'Software Programmer',	20,	'2016-07-15 20:09:41',	'2016-07-15 20:57:56'),
