(1,	20,	'This is a second topic',	'In Sails, database adapters are the middle man between your app and some kind of structured data storage (typically a database). But in order for an adapter to communicate between your Sails app and a particular database, it needs some additional information. That\'s where datastores come in. Datastores are dictionaries (plain JavaScript objects) that specify an adapter, as well as other necessary configuration information-- stuff like url, or host, port, username, and password.',	'[5, 6]',	NULL,	'this+is+a+cnhl3t',	0,	0,	'2018-04-13 21:28:12',	'2018-04-13 21:28:12'),
