INSERT INTO `jobs` (`id`, `author_id`, `title`, `description`, `employer_name`, `employer_email`, `external_url`, `location`, `category`, `mode_of_application`, `active`, `created_at`, `updated_at`, `short_url`, `type`) VALUES
(1,	21,	'Backend Engineer',	'<p>Own improvements to existing services as Lever scales to increasing usage and increasingly large enterprise accounts. Identify and anticipate performance bottlenecks across all Lever services and applications. Establish best practices, bridging between platform and product engineering.</p><p>Backend engineering is part of Lever&#39;s small platform engineering team that works directly with our CTO. Backend engineers improve the overall performance, reliability, and ability to measure existing systems. They collaborate with the product engineering team, who own full stack implementation of new features.</p><p>You will be able to teach peers patterns and best practices for production systems learned in previous roles as well as those gained from a broad understanding of Lever systems. At the same time, you&#39;ll learn from the unique challenges operating a large scale realtime, eventually consistent data model. Our applications are powered by&nbsp;<a href=\"https://github.com/share/sharedb\">ShareDB</a>, our distributed realtime application backend. ShareDB syncs all data via Operational Transformation, the same algorithm that powers Google Docs.</p><p>Improve user experience and engagement via performance and reliability improvements, help product engineering to continue focusing on feature innovation and product differentiation, and level up in a broad range of technical and communication skills.</p><p><strong>Core technologies:</strong></p><p>JavaScript, Node.js, MongoDB, Redis, Elasticsearch, DerbyJS, ShareDB, IMAP, SMTP, Gmail and Google Calendar, Microsoft Exchange, AWS</p><p><strong>Within 1 month, you&rsquo;ll&hellip;</strong></p><ul><li>Complete Lever&rsquo;s new-hire training week (a.k.a. Ramp Camp), and learn what it means to build a powerful recruiting platform.</li><li>Ramp up on Lever&rsquo;s engineering stack by pair-programming with your teammates and attending engineering training sessions designed and presented by your peers.</li><li>Complete your engineering starter project and deploy your first changes to production!</li></ul><p><strong>Within 3 months, you&rsquo;ll&hellip;</strong></p><ul><li>Implement more efficient real-time indexing pipeline from MongoDB into Elasticsearch</li><li>Implement on demand reindexing of Elasticsearch for an account or all accounts without interruption of service</li></ul><p><strong>Within 6 months, you&rsquo;ll&hellip;</strong></p><ul><li>Write improved data migrations framework</li><li>Measure capacity and latency of email sync service, project upcoming needs based on historical growth, and increase throughput to handle needs for 12 months from now</li><li>Update reporting data pipeline to use continuous MongoDB oplog tailing</li><li>Work closely with product engineering to educate on best practices: how to write efficient database queries, patterns for more performant tasks, identify performance bottlenecks for large customer accounts (i.e. how to write derby components performantly)</li></ul><p><strong>Within 12 months, you&rsquo;ll&hellip;</strong></p><ul><li>Provide input in architecture reviews of new features</li><li>Analyze data sent across the wire to clients and propose largest impact ways to reduce data size</li><li>Profile and optimize most expensive taskqueue jobs and crons</li><li>Optimize search and database query performance</li><li>Define tools and standards for product engineering to measure performance impact of releases</li></ul><p><strong>Future...</strong></p><ul><li>Replace current long polling connection library with better supported library, such as SockJS</li><li>Optimize API for large accounts and increasing volume of operations</li><li>Extrapolate trends in data use, load, etc. to anticipate upcoming bottlenecks</li><li>Identify data quality issues and write internal tools to improve data consistency</li></ul><p>&nbsp;</p>',	'Findworka',	'',	'https://bt.ly/356da',	'Lagos, Nigeria',	'Software Programmer',	3,	1,	'2017-03-23 18:43:21',	'2017-03-23 18:43:21',	'djhssafl564',	NULL),
(2,	21,	'PHP Developers',	'<p>Boxing is the trending training of choice. Modern day athletes as well as top Victoria secret models are implementing boxing into their workouts. This is because boxing is the ultimate test of one&rsquo;s fitness. It tests and develops mental fortitude, endurance, upper and lower body strength. To put it simply, boxing gets you to your peak physical and mental state fast! Look it up.</p><p>Elitebox brings a world-class boxing fitness solution to Lagos. Step into our playground as we bring the old school boxing to the mainstream. Run away from the treadmill and revolutionize your training with our unique and raw equipment, inspired by the training methods of the old greats like Mohammed Ali, Joe Louis, Sugar Ray Robinson, George Foreman to name a few.</p>',	'Findworka',	'',	'',	'Lagos, Nigeria',	'Web Designer/Developer',	1,	1,	'2017-03-24 11:32:49',	'2017-03-24 11:32:49',	'adkj123',	NULL),
(3,	1047,	'Part-time UI/UX designer',	'<p>A bridal online store needs the the expertise of a UI/UX designer who would be working remotely on the website for 1 year.</p>',	'Honeys\' bridal',	'',	'',	'Lagos, Nigeria',	'Web Designer/Developer',	1,	1,	'2017-09-11 14:11:30',	'2017-09-11 14:11:30',	'gnvGG8hsgT',	'part-time');
