(14,	'This is a Designer',	'wilfred@findworka.com',	'designer',	'5-7',	'facebook.com',	'behance.com',	'2018-05-21 13:33:41',	'2018-05-21 13:33:41',	1,	NULL,	0,	'Once json_encode() encounters $o->arr[0]==$o it would have to start again with $o, reach $o->arr[0], start again with $o and so on ad infinitum. To prevent this, the function \"remembers\" each node it already processed. If it \"sees\" the same node again it throws the recursion warning.\r\nThe simple_html_dom objects you return from your functions probably have reference to their parents objects or something like that, causing the recursion.',	'Avocode, Avocado',	'proCV_6HCUACE9wvgMIaD.svg',	'07059767184'),
