(58,	21,	'Web Developer',	'We are looking for an outstanding Web Developer to be responsible for the coding, \r\ninnovative design and layout of our client websites, e-commerce sites, landing pages, and applications (web, mobile, social). The role is responsible for designing, coding and modifying websites, from layout to function and according to specifications. Strive to create visually appealing, responsive custom developed sites that feature user-friendly design and clear navigation. \r\nYou will build websites and apps from concept all the way to completion from the bottom up, fashioning everything from the home page to site layout and function. \r\nN85,000- FULL TIME \r\n\r\nResponsibilities: \r\nWrite well designed, testable, efficient code by using best software development practices \r\nCreate website layout/user interface by using standard HTML/CSS practices \r\nIntegrate data from various back-end services and databases \r\nGather and refine specifications and requirements based on technical needs \r\nCreate and maintain software documentation \r\nBe responsible for maintaining, expanding, and scaling sites and portals ',	'Web designer/Developer',	'3 days',	'85000',	'Lagos',	'Lagos',	1,	0,	'2016-06-29 21:26:49',	'2016-06-29 21:26:49',	0,	0,	NULL,	NULL,	0,	0),
(59,	21,	'Creative, Visual & UI/UX Designer',	'We are looking for a super creative graphic designer with up-to-date \r\nknowledge to interpret our clients’ needs and to design solutions with high visual impact. You will work on a variety of products, including websites, books, magazines, product packaging, portal, exhibitions, corporate identity etc. The ideal candidate should have an eye for clean and artful design, possess UI skills and be able to translate requirements into interaction flows and artifacts, and transform them into beautiful, intuitive, and functional user interfaces.​ \r\nN70,000 – FULL TIME \r\nWe’re looking for someone to join our creative output, and help us take our digital work forward into \r\nnew and exciting directions. We need a highly creative person who understands branding and marketing, and can develop strong ideas that work across the full range of media covering digital (social media etc) and print. \r\nYou will be able to take a project from initial brief through brainstorming and wireframes, to concepts and ultimately finished designs ready for use \r\nYou will be comfortable working on any project thrown at you and have an excellent feel for what a great UX is and what a great UI looks like! \r\nThis is a highly creative role that will require good Photoshop, In design and Illustrator knowledge. You should be able to design for web, print and mobile devices. ',	'Web designer/Developer',	'3 days',	'70000',	'Lagos',	'Lagos',	1,	0,	'2016-06-29 21:29:02',	'2016-06-29 21:29:02',	0,	0,	NULL,	NULL,	0,	0),
(60,	277,	'SECURITY AND E-SECURITY',	'IF YOU ARE LOOKING FOR THE BEST TRAINED SECURITY GUARDS , SUPERVISOR AND SECURITY CONSULTANT , AND ALSO ALL YOUR SECURITY ICT SOLUTIONS, SUCH AS CCTV,FIRE ALARM,SECURITY PATROL GADGETS, E-DOCUMENT SECURITY ,ELECTRIC FENCING, JUST CALL....08037028354',	'Select Category',	'24 hours',	'AFFORDABLE PRICE',	'Online',	'ANY PLACE /STATE IN NIGERIA',	0,	0,	'2016-07-01 14:09:24',	'2016-07-01 14:09:24',	0,	0,	NULL,	NULL,	0,	0),
