(62,	180,	'Digital Marketing Associate- Full time',	'<p><strong>Digital marketing associate: </strong></p><p>If you live and breathe digital marketing, we want to talk to you. We are looking for a Digital Marketing associate to develop, implement, track and optimize our digital marketing campaigns across all digital & social channels.</p><p> </p><p><strong>Responsibilities:</strong></p><p>Plan and execute all web, SEO/SEM, marketing database, email, social media and display advertising campaigns</p><p>Generate, edit, publish and share daily content (original text, images, video or HTML) that builds meaningful connections and encourages community members to take action</p><p>Create editorial calendars and schedules</p><p>Design, build and maintain our social media presence</p><p>Measure and report performance of all digital marketing campaigns, and assess against goals (ROI and KPIs)</p><p>Identify trends and insights, and optimize spend and performance based on the insights</p><p>Brainstorm new and creative growth strategies</p><p>Plan, execute, and measure experiments and conversion tests</p><p>Collaborate with internal teams to create landing pages and optimize user experience</p><p>Evaluate emerging technologies. Provide thought leadership and perspective for adoption where appropriate</p><p>Content Marketing - Demonstrated experience with successful management and execution of a content marketing strategy including managing company\'s blog and managing editorial calendar</p><p>Search Engine and Social Media Optimization - A demonstrated ability to drive traffic to web properties from search engines and proven experience using social media channels to distribute and amplify the organization’s content.</p><p>Editing - Proven editorial skills including strong language skills and the ability to adjust content to remain consistent with brand, style and tone.</p><p>Copywriting and lead generation - An understanding of how to create and present content that persuades, that can generate leads and sales.</p><p>Analytics - An excellent command of analytics platforms, such as Google Analytics to adjust marketing strategy and tactics</p><p><strong>Requirements:</strong></p><p>Relevant certifications (e.g Google Adwords, Google Analytics, Hubspot Inbound, Shaw Academy e.t.c)</p><p>Proven working experience in digital marketing</p><p>Demonstrable experience leading and managing SEO/SEM, marketing database, email, social media and/or display advertising campaigns</p><p>Highly creative with experience in identifying target audiences and devising digital campaigns that engage, inform and motivate</p><p>Solid knowledge of website analytics tools (e.g., Google Analytics, NetInsight, Omniture, WebTrends)</p><p>Working knowledge of ad serving tools (e.g., DART, Atlas)</p><p>Experience in setting up and optimising Google Adwords campaigns</p><p>Strong analytical skills and data-driven thinking</p><p>Up-to-date with the latest trends and best practices in online marketing and measurement</p><p>Skills and experience in creative content writing</p><p>Proven working experience in social media or related field</p><p>Excellent consulting, writing, editing (photo/video/text), presentation and communication skills</p><p>Familiarity with web technologies like wordpress</p><p>Positive attitude, detail and customer oriented with good multitasking and organisational ability</p><p> </p>',	'Select Category',	'24 hours',	'N100,000',	'Lagos',	'Our office location (Sabo-Alagomeji).',	0,	0,	'2016-07-04 14:45:21',	'2016-08-08 16:33:35',	0,	0,	NULL,	NULL,	0,	0),
