(65,	180,	'3 Java Developers wanted ',	'<p><strong>Description:</strong></p><p>Access Tecknologies International is looking for an Experienced Java Developer with extensive application development knowledge having worked on Project for a reputable organization. The developer must have knowledge in e-payment intergrate and meet the following skills requirement. The developer is needed for Urgent contract.</p><p><strong>Skills and Experience</strong><br />General Skills requirement for all contractors<br />&bull; Experience with and commitment to key development practices inherent to effective agile development, including:<br />o Continuous integration, including use of integration tools<br />&bull; Familiarity with object-oriented design and development, including design patterns and effective use of interfaces<br />&bull; Experience with standard development environment:<br />o Java<br />o Spring technologies, including Security, JDBC, Web Flow (subject to change based on how we handle query UI)*<br />&bull; XML Schema<br />&bull; Programing language security model and handling X509 certificates, trust stores, etc.<br />&bull; Enterprise integration (building adapters to integrate with legacy/COTS systems)<br />&bull; Web services implementation toolkit<br />&bull; WS-Reliable Messaging, WS-Security, WS-Trust, and WS-Addressing<br />&bull; WS-Security with SAML</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>',	'Software Programmer',	'No timeline',	'N250,000',	'Online',	'Note: Project duration could range from 2 weeks to 1 month depending on the developers\' proficiency and initial agreement.',	0,	0,	'2016-07-15 18:49:12',	'2016-08-22 19:51:54',	0,	0,	NULL,	NULL,	0,	0),
