(94,	21,	'Wordpress Website',	'<p>A WordPress website needed urgently for a corporate firm. Content will be provided as soon as the project starts.</p>',	'Web Designer/Developer',	'7 days+',	'',	'Online',	'Using this medium',	1,	0,	'2016-09-09 18:34:52',	'2016-09-09 18:34:52',	0,	0,	NULL,	NULL,	0,	0),
(95,	246,	'Software developer for a web app',	'<p>Need a software developer to put together a web app with a specific list of functionalities to be provided in a detailed brief according to pre-agreed milestones within a two-month period. The developer should be sound in PHP or Python and work well with HTML5/CSS/JavaScript. As part of the project, the developer will integrate a specific PHP codebase from an open-source project that will be provided upon commencement.&nbsp;</p><p>The developer may be required to work exclusively on the project for at least 5 hours a day, 3days a week (choice of days is yours) from a space already provided for this purpose around&nbsp;Yaba (although, last last you can work remotely, so this clause is kind of optional). The developer will provide a detailed work plan&nbsp;with specific weekly deliverables to be adhered to for the duration of the project. We can work together to come up with the work plan.</p><p>Will be helpful, but not necessary to see links&nbsp;to your past works. Buzz me up on/before September 30th, 2016.&nbsp;</p>',	'Web Designer/Developer',	'Others (7 days+)',	'60000',	'Lagos',	'Offline',	1,	0,	'2016-09-15 12:28:38',	'2016-09-17 22:26:37',	0,	1,	NULL,	NULL,	0,	0),
(96,	21,	'Graphic Designer - Full Time',	'<ul><li>The graphic designer will work closely with the director</li><li>Meet with the director to determine the scope of a project</li><li>Advise the director on strategies to reach a particular audience</li><li>Determine the message the design should portray</li><li>Use graphics to tell stories on social media and manage responses.</li><li>Create images that identify a situation or convey a message</li><li>Develop graphics and visual or images for product illustrations, logos, and websites</li><li>Create designs either by hand or using computer software packages</li><li>Select colours, images, text style, and layout</li><li>Present the design to the director</li><li>Incorporate changes recommended by the director into the final design</li><li>Review designs for errors before printing or publishing them.</li></ul>',	'Graphic Designer',	'7 days+',	'70000',	'Lagos',	'You will resume work every day at our office on the Island',	1,	0,	'2016-09-16 12:13:23',	'2017-07-18 16:58:54',	0,	0,	NULL,	NULL,	0,	0),
(97,	21,	'Need Fantastically Good Phython Developers for a Project',	'<p>We are looking for Python Web Developers responsible for managing the interchange of data between the server and the users. Your primary focus will be the development of all server-side logic, ensuring high performance and responsiveness to requests from the front-end. You will also be responsible for integrating the front-end elements built by your co-workers into the application; therefore, a basic understanding of front-end technologies is necessary as well.</p><p><strong>Responsibilities</strong></p><ul><li>Writing reusable, testable, and efficient code</li><li>Design and implementation of low-latency, high-availability, and performant applications</li><li>Integration of user-facing elements developed by front-end developers with server side logic</li><li>Implementation of security and data protection</li><li>Integration of data storage solutions&nbsp;<strong>{{may include databases, key-value stores, blob stores, etc.}}</strong></li></ul><p><strong>Skills And Qualifications</strong></p><ul><li>Expert in Python, with knowledge of at least one Python web framework&nbsp;<strong>{{such as Django, Flask, etc depending on your technology stack}}</strong></li><li>Able to integrate multiple data sources and databases into one system</li><li>Understanding of the threading limitations of Python, and multi-process architecture</li><li>Good understanding of server-side templating languages&nbsp;<strong>{{such as Jinja 2, Mako, etc depending on your technology stack}}</strong></li><li>Basic understanding of front-end technologies, such as JavaScript, HTML5, and CSS3</li><li>Understanding of accessibility and security compliance&nbsp;</li><li>Knowledge of user authentication and authorization between multiple systems, servers, and environments</li><li>Understanding of fundamental design principles behind a scalable application</li><li>Familiarity with event-driven programming in Python</li><li>Understanding of the differences between multiple delivery platforms, such as mobile vs desktop, and optimising output to match the specific platform</li><li>Able to create database schemas that represent and support business processes</li><li>Strong unit test and debugging skills</li><li>Proficient understanding of code versioning tools&nbsp;<strong>{{such as Git, Mercurial or SVN}}</strong></li></ul>',	'Web Designer/Developer',	'7 days+',	'',	'Online',	'Work will be carried offline and online. You will be asked to come in once in a while to take briefs and show progress on the project.',	1,	0,	'2016-09-16 12:19:14',	'2016-09-16 12:19:14',	0,	0,	NULL,	NULL,	0,	0),
