(99,	21,	'Business Development Manager',	'<p>Business Development Managers Only. Come build an empire within our fine, progressive company. We are in the technology industry and a service based company. We need a smart and intelligent BDM. If you&rsquo;re average or a star, young or old, if you have stuff, we&rsquo;ll know. Apply.</p>',	'Business Developer',	'7 days+',	'',	'Lagos',	'Lagos, Nigeria',	1,	0,	'2016-11-01 19:18:17',	'2016-11-01 19:18:17',	0,	0,	NULL,	NULL,	0,	0),
