(191,	255,	'Web designer/Developer',	'Graphic designer',	'Web hosting, Search Engine Optimization, Website maintenance, Online advertisement, E-commerce ',	'Getting a professional websit with top specifications and functions can be rather expensive. My company, DOT WEBERS Enterprise, is looking into that by providing Premium Quality Websites at Affordable rates. ',	'',	'',	'<p>MD, DOT Webers Enterprise.</p><p>I have a creative personality with keen interest in solving problems, skill acquisition and personal development. I&#39;m friendly, open-minded, goal oriented, hardworking... Love for whatever i find myself doing is what drives my performance.<br />I strive to be an indispensable part of any organization I work with.</p><p><strong>Why should you entrust me with your website design/development project?&nbsp;</strong></p><p>Well, read this short story &nbsp;about me.&nbsp;</p><p>&quot;Hello!&nbsp;If you are reading this then you most likely already know my name. Simply put, I am a natural at many things but as a lover of tech especially computers, my base profession is Website design and development. Being a problem solver I&#39;m also a graduate Engineer from the University of Ibadan; oh, and i did&#39;nt study computer science/engineering but I am a professional web developer. I&#39;ve been developing website for over 5years now and within that period i&#39;ve learnt different programming languages.&nbsp;</p><p>If you need a professional website, do contact me because I am skilled. A lot of people today claim to develop websites using CMS platforms and having no programming background...well, i can tell you this much that they have a limit to what they can do.&nbsp;<br />Here is why you should consider opting for me:<br />I started web development over 5years ago from the scratch with HTML(Hypertext Markup Language) building personal horrible looking sites. I then moved further to learn CSS(Cascading style sheet) and my websites started looking better. To further give life to my websites, I learned Javascript, &nbsp;JQUERY, AJAX, PHP, MySQL and a tiny bit of RUBY. My websites started making more sense. Meanwhile, during this learning curve, i also developed skills for Photoshop, &nbsp;coreldraw, Microsoft applications etc.&nbsp;<br />Then, &nbsp;i hated CMS(content management systems) but at some point, I was forced to learn one...don&#39;t laugh at me. The CMS experience was awesome and became more awesome or awsomer - if you&#39;ll permit me - when my programming skills started giving me an edge over regular CMS users. Because of my knowledge of several web programming languages, unscrewing the bolts &amp; nuts of any CMS became a norm to me.&nbsp;<br />End result: I build better websites because I know how the code works. My accumulated skills, knowledge and tools also helps me to build professional websites faster as I&#39;ll get your Job done in 3-7 working days.&nbsp;<br />Still not convinced about choosing me?<br />Well, &nbsp;I&#39;ll like you to know that my work ethics are based on Trust, Honesty, Quality and Affordability. I work hard but smart. With me, &nbsp;developing websites is not about the money because I&#39;m in love with it and that&#39;s perfect for you.&nbsp;<br />How, you may ask?<br />I put my best in everything I do and I derive satisfaction from giving my clients the best value for their money.<br />I have keen interest in helping businesses grow by letting them tap into the numerous benefits of having a website. As a result of this, &nbsp;I started a web development firm with some colleagues. You can find out everything you need to know about what we do at www.dotwebers.com.<br />In conclusion, whatever your web development needs are, &nbsp;do not hesitate to contact me personally or through my company&#39;s website. By the time we are through with you, you&#39;ll be glad you did business with us because...we are all about you.&nbsp;</p><p>Oh, one more thing, I am not perfect. There are things i can&#39;t do but don&#39;t hesitate to contact. Even if for one reason or the other i can&#39;t handle your project, I will be more than willing to guide you towards getting the best solution. &quot;</p>',	'0000-00-00 00:00:00',	'2016-09-08 13:27:51'),
