(209,	275,	'Customer care representative',	'Administrative officer',	'Cateering',	'I love dealing with customers. I really enjoy the interaction with people and find no problem answering even the most trivial questions. I get a deep sense of satisfaction when solving problems or helping customers out in one way or another.\r\n\r\nHowever,i know i can survive the challenges not only because i have had several experiences over the years but because i am a social,smart hard worker.\r\n\r\nI am also multi-lingual, multi-talented, able to juggle-ten-things-at-one-time, never-get-tired, won’t-back-down-from-a-challenge, outside of the box thinker who is ready to tackle the world. \r\n',	'As the \'eyes and ears of a company\', administrative professionals handle the day to day administration for an individual, network or team. With their unique overview of the company, administrative assistants are regularly called upon to make business critical decisions – it\'s no exaggeration to say that an executive is only as good as their assistant hence this role has made me have these traits:\r\nOrganized approach \r\nCommunication skills \r\nPersonable phone manner \r\nInitiative \r\nPC literacy\r\nHonesty and discretion \r\nTime management \r\nTeam ethic \r\nAbility to cope with pressure \r\nProfessionalism',	'Why do I love what I chose to do for the rest of my life?\r\n\r\nWait, no. I didn\'t choose it. It chose me.\r\n\r\nDoing something with my hands frees up my brain to think about other things. The pleasure of removing something perfect from the oven is unique. Giving people something I made, with my own huge, knobbly hands.\r\n\r\nI live for watching people eat that first bite, knowing that for a blessed second their world has stopped spinning. Seeing people close their eyes and experience that tiny little food orgasm is sunshine for my soul.',	'I graduated from Enugu State University where i studied Public Administration in 2002.\r\nMy academic and work experience has taught me to work well with other\r\npeople and to take responsibility for my own work. I have\r\nlearned how to communicate with people in situations which require\r\ntact\r\nAs a student, I worked as a Sales Representative for Guinness Nigeria\r\nPlc. After I graduated from the University of Enugu with a degree in Public\r\nAdministration, I was offered first, a job at Wildflower PR & Coy Ltd\r\nas the Personal Assistant to CEO, and i worked as a Call Centre Agent\r\nat Jumia Nigeria and Contec Global Infotech.Now I have gained experience in,\r\n\r\n.\r\nSales and customer satisfaction.\r\nAdministrative and office documentation /support.\r\nAggressive salesmanship.\r\n',	'0000-00-00 00:00:00',	'2016-07-01 15:18:52'),
