(221,	292,	'Web designer/Developer',	'Web designer/Developer',	'Graphic Design, E-marketing, SEO',	'Web design involves creating the visual design of a digital asset like a webpage or email, as well as arranging the information in an engaging, intuitive way. Also known as interactive designers, they work with Adobe Creative Suite programs like Photoshop and Illustrator to create their designs. They may also know HTML and CSS.',	'a web designer can help you with your project. They can give your website, e-commerce site, or app a fresh look and feel. They also create graphics for social media accounts and design themes for blogs or websites created in content management systems (CMS) like WordPress, Joomla!, or Drupal.',	'If you need a website, logo, banner ad, landing page, mobile app, or email campaign designed, ',	'                  I\'M SIMON\r\nI\'M A CREATIVE WEB DEVELOPER\r\n      I STAND ON A SWEET SPOT \r\nWHERE DESIGN & CODE INTERSECTS.\r\n           LET\'S WORK TOGETHER.\r\nI\'M CURRENTLY ACCEPTING SELECT DESIGN PROJECTS.\r\n',	'0000-00-00 00:00:00',	'2016-07-12 07:26:51'),
