INSERT INTO `trainings` (`id`, `title`, `description`, `image`, `registration_deadline`, `start_date`, `end_date`, `short_url`, `location`, `cost`, `skills`, `category_id`, `user_id`, `active`, `views`, `created_at`, `updated_at`, `sits`, `vat_type`, `vat`) VALUES
(3,	'Findworka Dev Camp',	'<p>bbdbdbdjdjjcbcbdhdhdhdhdhdhdhdhbcbcbcbcbcbcbcbcbjcbcchbdhbhdbhbdhbdhbdhbdhbdhbhdbhdhbdhbdhbdbhb</p>',	'training_Z2xLnMUrwf.png',	'2016-09-07',	'2016-09-15',	'2016-09-30',	'4SBHRuq',	'13 Hughes Avenue, Alagomeji, Yaba, Lagos',	'7000',	'',	10,	21,	1,	3,	'2016-09-23 20:55:09',	'2016-11-04 19:10:47',	10,	NULL,	NULL),
(4,	'Data Science - Machine Learning / Big Data',	'Our Data Science and Machine Learning fully immersive cohort is an 8 week course.\r\n\r\nDecision science is the brains behind big data analytics. It\'s not a new field; people have been doing decision science for decades. In the \"old days\" data was limited, hence complex algorithms were needed to extract useful insights from the data. Given the shift in the data paradigm, we no longer need very complex algorithms. Instead, we need to run simple stuff at scale. \r\n\r\nAt the end of the day, data science is all about counting smart. In this course, we will learn the essential coding skills for Data Science, implement various industry standard algorithms on large datasets and learn to communicate the results through strong visualizations. And, all the while, we will keep it simple. \r\nDecision Science is a mix of Computer Science, Statistics, and Management Skills. In this bootcamp, we will focus on Computer Science (C) and Statistics (S).',	'trainings_BpJHw6fNnKnYdFB.jpg',	'2017/02/13',	'2017/02/15',	'2017/03/31',	'ay3Y0Ck',	'234 My Way Street, My Town, My State, My Country',	'300000',	'R Programming, Hadoop, MapReduce, UNIX, MySQL',	40,	21,	1,	5,	'2017-02-06 15:50:33',	'2017-02-12 20:02:41',	7,	NULL,	NULL),
(5,	'Findworka Dev Camp',	'<p>bbdbdbdjdjjcbcbdhdhdhdhdhdhdhdhbcbcbcbcbcbcbcbcbjcbcchbdhbhdbhbdhbdhbdhbdhbdhbhdbhdhbdhbdhbdbhb</p>',	'training_Z2xLnMUrwf.png',	'2016-09-07',	'2016-09-15',	'2016-09-30',	'4SBHRuq',	'13 Hughes Avenue, Alagomeji, Yaba, Lagos',	'FREE',	'',	10,	21,	1,	3,	'2016-09-23 20:55:09',	'2016-11-04 19:10:47',	10,	NULL,	NULL),
(6,	'Data Science - Machine Learning / Big Data',	'Our Data Science and Machine Learning fully immersive cohort is an 8 week course.\r\n\r\nDecision science is the brains behind big data analytics. It\'s not a new field; people have been doing decision science for decades. In the \"old days\" data was limited, hence complex algorithms were needed to extract useful insights from the data. Given the shift in the data paradigm, we no longer need very complex algorithms. Instead, we need to run simple stuff at scale. \r\n\r\nAt the end of the day, data science is all about counting smart. In this course, we will learn the essential coding skills for Data Science, implement various industry standard algorithms on large datasets and learn to communicate the results through strong visualizations. And, all the while, we will keep it simple. \r\nDecision Science is a mix of Computer Science, Statistics, and Management Skills. In this bootcamp, we will focus on Computer Science (C) and Statistics (S).',	'trainings_BpJHw6fNnKnYdFB.jpg',	'2017/02/13',	'2017/02/15',	'2017/03/31',	'ay3Y0Ck',	'234 My Way Street, My Town, My State, My Country',	'300000',	'R Programming, Hadoop, MapReduce, UNIX, MySQL',	40,	21,	1,	5,	'2017-02-06 15:50:33',	'2017-02-12 20:02:41',	7,	NULL,	NULL),
